import fileApi from '@/api/file';
import { Notification } from 'element-ui';
import { mapGetters } from 'vuex';
export default {
  name: 'visualize-echarts',
  props: {
    seclectedCol: {
      type: Array
    },
    pid: {
      type: String
    }
  },
  computed: {
    isShowEcharts: {
      get: function get() {
        var show = this.$store.getters.isShowEcharts;

        if (show) {}

        return show;
      },
      set: function set(val) {
        this.$store.commit('app/SET_ISSHOWECHARTS', val);
      }
    }
  },
  data: function data() {
    return {
      chartDatas: [],
      // chartData: {
      //   columns: ['日期', '访问用户', '下单用户', '下单率'],
      //   rows: [
      //     { 日期: '1/1', 访问用户: 1393, 下单用户: 1093, 下单率: 0.32 },
      //     { 日期: '1/2', 访问用户: 3530, 下单用户: 3230, 下单率: 0.26 },
      //     { 日期: '1/3', 访问用户: 2923, 下单用户: 2623, 下单率: 0.76 },
      //     { 日期: '1/4', 访问用户: 1723, 下单用户: 1423, 下单率: 0.49 },
      //     { 日期: '1/5', 访问用户: 3792, 下单用户: 3492, 下单率: 0.323 },
      //     { 日期: '1/6', 访问用户: 4593, 下单用户: 4293, 下单率: 0.78 }
      //   ]
      // }
      graphId: 0
    };
  },
  created: function created() {
    var _this = this;

    this.graphId = this.$route.params.id || this.$store.getters.graphId;
    var selectedIndex = [];
    this.seclectedCol.forEach(function (col) {
      selectedIndex.push(col[0]);
    });
    console.log(selectedIndex);
    fileApi.previewEcharts({
      graphId: this.graphId,
      queries: selectedIndex,
      pid: this.pid
    }).then(function (res) {
      var data = res.data;

      for (var i in data) {
        var chartData = {};
        var rows = [];
        var index = 1;
        data[i].forEach(function (d) {
          var obj = {};
          obj['Series'] = index++;
          obj["Col ".concat(i)] = d;
          rows.push(obj);
        });
        chartData.id = i;
        chartData.columns = ['Series', "Col ".concat(i)];
        chartData.rows = rows;

        _this.chartDatas.push(chartData);
      }
    });
  }
};
